  return(
      <div className="container">
        <div className="row">
        <h1 className="page-title">Products</h1>       
        </div>
        <div className="row">
          <div className="col-8 text-start"><b>Total no. of products</b> </div>
          <div className="col-4"> <button className="btn btn-outline-primary" type="button">Add Products</button></div>
        </div>
        
        </div>
  )
}
 export default Products;
